package app.groceryapp.data.model.api.response.product;import com.google.gson.annotations.Expose;import com.google.gson.annotations.SerializedName;public class ProductQuantity {    @SerializedName("quantity_id")    @Expose    private Integer quantityId;    @SerializedName("product_id")    @Expose    private Integer productId;    @SerializedName("items_multiplier")    @Expose    private Integer itemsMultiplier;    @SerializedName("product_quantity")    @Expose    private Integer productQuantity;    @SerializedName("unit_id")    @Expose    private Integer unitId;    @SerializedName("product_price")    @Expose    private double productPrice;    @SerializedName("product_offer_percent")    @Expose    private double productOfferPercent;    @SerializedName("product_with")    @Expose    private Object productWith;    @SerializedName("in_stock")    @Expose    private Integer inStock;    @SerializedName("is_active")    @Expose    private Integer isActive;    @SerializedName("unit")    @Expose    private Unit unit;    public Integer getQuantityId() {        return quantityId;    }    public void setQuantityId(Integer quantityId) {        this.quantityId = quantityId;    }    public Integer getProductId() {        return productId;    }    public void setProductId(Integer productId) {        this.productId = productId;    }    public Integer getItemsMultiplier() {        return itemsMultiplier;    }    public void setItemsMultiplier(Integer itemsMultiplier) {        this.itemsMultiplier = itemsMultiplier;    }    public Integer getProductQuantity() {        return productQuantity;    }    public void setProductQuantity(Integer productQuantity) {        this.productQuantity = productQuantity;    }    public Integer getUnitId() {        return unitId;    }    public void setUnitId(Integer unitId) {        this.unitId = unitId;    }    public double getProductPrice() {        return productPrice;    }    public void setProductPrice(double productPrice) {        this.productPrice = productPrice;    }    public double getProductOfferPercent() {        return productOfferPercent;    }    public void setProductOfferPercent(double productOfferPercent) {        this.productOfferPercent = productOfferPercent;    }    public Object getProductWith() {        return productWith;    }    public void setProductWith(Object productWith) {        this.productWith = productWith;    }    public Integer getInStock() {        return inStock;    }    public void setInStock(Integer inStock) {        this.inStock = inStock;    }    public Integer getIsActive() {        return isActive;    }    public void setIsActive(Integer isActive) {        this.isActive = isActive;    }    public Unit getUnit() {        return unit;    }    public void setUnit(Unit unit) {        this.unit = unit;    }}